  false,\n\t\"url\": null,\n\t\"notes\": \"The Federal Register is the official daily
  publication for rules, proposed rules, and notices of Federal agencies and organizations,
  as well as executive orders and other presidential documents. Published by the Office
  of the Federal Register (OFR), National Archives and Records Administration (NARA),
  it is updated daily and is available Monday through Friday, except Federal holidays.
  GPO's Federal Digital System (FDsys) contains Federal Register issues from 1994
  to the present. The current XML data set is not yet an official format of the Federal
  Register.  Only the PDF and Text versions have legal status as parts of the official
  online format of the Federal Register.  The XML-structured files are derived from
  SGML-tagged data and printing codes, which may produce anomalies in display. In
  addition, the XML data does not yet include image files. Users who require a higher
  level of assurance may wish to consult the official version of the Federal Register
  on <a href=\"http://www.gpo.gov/\">FDsys.gov</a>.  The FDsys data set includes digitally
  signed Federal Register PDF files, which may be relied upon as evidence in a court
  of law. See:  <a href=\"http://www.gpo.gov/fdsys/browse/collection.action?collectionCode=FR\">http://www.gpo.gov/fdsys/browse/collection.action?collectionCode=FR</a>\",\n\t\"license_title\":
